import React, { useState } from 'react';
import { Upload, FileText, Plus, Trash2, Eye } from 'lucide-react';

const MenuUpload: React.FC = () => {
  const [uploadedFiles, setUploadedFiles] = useState([
    { id: 1, name: 'Summer Menu 2024', date: '2024-08-04', status: 'processed' },
    { id: 2, name: 'Spring Menu 2024', date: '2024-07-15', status: 'optimized' },
    { id: 3, name: 'Winter Menu 2023', date: '2023-12-01', status: 'archived' },
  ]);

  const handleFileUpload = (event: React.ChangeEvent<HTMLInputElement>) => {
    const files = event.target.files;
    if (files && files.length > 0) {
      // TODO: Implement actual file upload
      console.log('File uploaded:', files[0].name);
    }
  };

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'processed':
        return 'text-accent-cyan';
      case 'optimized':
        return 'text-green-400';
      case 'archived':
        return 'text-gray-400';
      default:
        return 'text-gray-400';
    }
  };

  const getStatusBg = (status: string) => {
    switch (status) {
      case 'processed':
        return 'bg-accent-cyan/10';
      case 'optimized':
        return 'bg-green-400/10';
      case 'archived':
        return 'bg-gray-400/10';
      default:
        return 'bg-gray-400/10';
    }
  };

  return (
    <div className="p-6">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-white mb-2">Menu Management</h1>
        <p className="text-gray-400">Upload and manage your restaurant menus for AI optimization.</p>
      </div>

      {/* Upload Section */}
      <div className="bg-gray-800 rounded-lg border border-gray-700 p-6 mb-8">
        <h2 className="text-xl font-semibold text-white mb-4">Upload New Menu</h2>
        
        <div className="border-2 border-dashed border-gray-600 rounded-lg p-8 text-center">
          <Upload className="w-12 h-12 text-gray-400 mx-auto mb-4" />
          <h3 className="text-lg font-medium text-white mb-2">Upload your menu file</h3>
          <p className="text-gray-400 mb-4">Support for CSV, JSON, and Excel files</p>
          
          <label className="inline-flex items-center px-4 py-2 bg-accent-blue text-white rounded-lg hover:bg-accent-blue/90 transition-colors cursor-pointer">
            <Plus className="w-4 h-4 mr-2" />
            Choose File
            <input
              type="file"
              className="hidden"
              accept=".csv,.json,.xlsx,.xls"
              onChange={handleFileUpload}
            />
          </label>
        </div>
      </div>

      {/* Menu List */}
      <div className="bg-gray-800 rounded-lg border border-gray-700 p-6">
        <div className="flex items-center justify-between mb-6">
          <h2 className="text-xl font-semibold text-white">Your Menus</h2>
          <button className="flex items-center space-x-2 px-4 py-2 bg-accent-cyan text-white rounded-lg hover:bg-accent-cyan/90 transition-colors">
            <Plus className="w-4 h-4" />
            <span>New Menu</span>
          </button>
        </div>

        <div className="space-y-4">
          {uploadedFiles.map((file) => (
            <div key={file.id} className="flex items-center justify-between p-4 bg-gray-700 rounded-lg">
              <div className="flex items-center space-x-4">
                <FileText className="w-8 h-8 text-accent-cyan" />
                <div>
                  <h3 className="text-white font-medium">{file.name}</h3>
                  <p className="text-gray-400 text-sm">Uploaded on {file.date}</p>
                </div>
              </div>
              
              <div className="flex items-center space-x-3">
                <span className={`px-3 py-1 rounded-full text-xs font-medium ${getStatusColor(file.status)} ${getStatusBg(file.status)}`}>
                  {file.status}
                </span>
                
                <button className="p-2 text-gray-400 hover:text-white hover:bg-gray-600 rounded-lg transition-colors">
                  <Eye className="w-4 h-4" />
                </button>
                
                <button className="p-2 text-gray-400 hover:text-red-400 hover:bg-gray-600 rounded-lg transition-colors">
                  <Trash2 className="w-4 h-4" />
                </button>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default MenuUpload;
